import React from "react";

const Catogreis = () => {
  const FilterCatogries = ["All", "Photos", "illustration", "vectors"];

  let num = 0;

  const fetcatfilter = (data) => {
    alert(data);
  };

  return (
    <>
      <div className="filter-catogries">
        {FilterCatogries.map((filter) => {
          return (
            <>
              <div
                key={num++}
                className="filter-cat-name "
                onClick={() => fetcatfilter(filter)}
              >
                {filter}
              </div>
            </>
          );
        })}
      </div>
    </>
  );
};

export default Catogreis;
